SELECT Processed, COUNT(*) AS DOCUMENTOS
    FROM ddoc_nadro.ddoc.IndexQueue
    GROUP BY Processed

SELECT *
    FROM ddoc_nadro.ddoc.IndexQueue
    WHERE Processed = 0

