     , C8                                            AS Contraparte
     , C9                                            AS TipodeContrato
     , C10                                           AS NúmerodeExpediente
     , C11                                           AS NombredeContrato
     , FORMAT(CONVERT(DATE, C12, 103), 'dd/MM/yyyy') AS FechadeCelebración
     , C13                                           AS Contraprestación
     , C14                                           AS Moneda
     , FORMAT(CONVERT(DATE, C15, 103), 'dd/MM/yyyy') AS FechaIniciodeVigencia
